Create a new Kotlin file and type this: import kweb.* fun main() { Kweb(port = 16097) { doc.body { h1().text("Hello World!") } }
} Run it, and then visit http://localhost:16097/ in your web browser to see the traditional greeting, translating to the following HTML body: <body> <h1>Hello World!</h1>
</body> This simple example already illustrates some important features of Kweb: Getting a kwebsite up and running is a breeze, no messing around with servlets, or third party webservers Your Kweb code will loosely mirror the structure of the HTML it generates

11.body:
One way to think of Kweb is as a domain-specific language (DSL) for building and manipulating a DOM in a remote web browser, while also listening for and handing DOM events. Importantly, this DSL can also do anything Kotlin can do, including features like for loops, functions, coroutines, and classes. Here is a simple example using an ordinary Kotlin for loop : fun helloWorld2() { Kweb(port = 16097) { doc.body { ul { for (x in 1..5) { li().text("Hello World $x!") } } } }
} To produce... <body> <ul> <li>Hello World 1!</li> <li>Hello World 2!</li> <li>Hello World 3!</li> <li>Hello World 4!</li> <li>Hello World 5!</li> </ul>
</body> You can use functions for modularization and reuse: fun helloWorld3() { Kweb(port = 16097) { doc.body { ul { fun ElementCreator<ULElement>.createMessage(x: Int) { li().text("Hello World $x!") } for (x in 1..5) { this.createMessage(x) } } } }
} As you can see this is an extension function, which allows you to use the Kweb DSL within the newly created function. Don't worry if youre unsure about this because you can use IntelliJs extract function refactoring to create these functions automatically.

16.body:
The DSL syntax makes it very easy to create elements and their children together: ul { li().text("One") li().text("Two")
} Alternatively we can use the [new {}]{.title-ref} function on Elements to add children to a pre-existing Element: val unorderedList : ULElement = ul()
unorderedList.new { li().text("One") li().text("Two")
}

17.body:
Kweb can also read from the DOM, in this case the value of an <input> element: val input: InputElement = input(type = InputType.text)
// A KVar is a mutable value to which you can add listeners
val inputKVar = input.value
inputKVar.addListener { old, new -> println("Input changed from $old to $new")
} Events can evaluate a JavaScript expression and send the result to the server, in this case we give it an expression that will retrieve the value of an InputElement, conveniently provided by valueJsExpression. ::: note ::: title Note ::: See the Observer Pattern & State section for ::: another way to read input element values.

21.body:
You can attach event handlers to DOM elements: doc.body { val label = h1() label.text("Click Me") label.on.click { label.text("Clicked!") }
} Most if not all JavaScript event types are supported, and you can read event data like which key was pressed: doc.body { val input = input(type = InputType.text) input.on.keypress { keypressEvent -> println("Key Pressed: ${keypressEvent.key}") }
}

